        <a id="contact_link" href="/contact" title="Узнать контакты" onclick="Scroll_page('contact'); event.preventDefault();">Контакты</a>
    </nav>

    <div id="account_corner" class="account_corner">
        @auth('web')
            <img class="account_photo" alt="account_photo" src="/images/account_photo.svg">
            <div style="display: inline-block; text-align: left; vertical-align: middle;">
                <span style="color: #FFF; margin: 0 5px;">{{Auth::user()->name}}</span>
                <p style="color: #999999; margin: 0 5px;">{{Auth::user()->email}}</p>
            </div>
            <button id="logout_button" onclick="window.location='{{route("logout")}}'" title="Выйти из аккаунта">Выйти</button>
        @endauth

        @guest('web')
            <button onclick="window.location='{{route("login")}}'" title="Войти в аккаунт" style="border: 1px solid #FFF;">Войти</button>
        @endguest
    </div>

    <div id="fullscreen_image">
        <button id="close_fullscreen" onclick="fullscreen_image.style.display = 'none';" title="Закрыть">&#10005;</button>
    </div>
</header>

